// src/components/TutorHome.js

import React from 'react';

const TutorHome = () => {
  return (
    <div>
      <h1>Welcome to the Tutor Home Page</h1>
      <p>This is the home page for Tutors. Here you can post job listings and manage applications.</p>
    </div>
  );
};

export default TutorHome;
